import React, { Component } from 'react';
import './App.css';
import Navega from './components/Navegacion';
import {cursos} from './cursos';
console.log(cursos);
class App extends Component{
  //React es capaz
  render(){
    return (
      <div className="App">
          <Navega titulo="Home"/>
          <button>OK</button>
      </div>
    );
  }
}

export default App;
